erun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-indent:28.8000pt; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-indent:28.8000pt; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-indent:28.8000pt; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-indent:28.8000pt; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;组委会</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal" style="text-indent:28.8000pt; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2015年11月</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal" style="text-indent:28.8000pt; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-indent:28.8000pt; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-align:center; "><span style="mso-spacerun:'yes'; font-family:宋体; font-weight:bold; font-size:18.0000pt; mso-font-kerning:1.0000pt; "><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-align:center; "><span style="mso-spacerun:'yes'; font-family:宋体; font-weight:bold; font-size:18.0000pt; mso-font-kerning:1.0000pt; "><o:p>&nbsp;</o:p></span></p><p class="MsoNormal" style="text-align:center; "><span style="mso-spacerun:'yes'; font-family:宋体; font-weight:bold; font-size:18.0000pt; mso-font-kerning:1.0000pt; ">竞赛规程</span><span style="mso-spacerun:'yes'; font-family:宋体; font-weight:bold; font-size:18.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">一、竞赛日期和地点&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">2015&nbsp;年&nbsp;11&nbsp;月&nbsp;10&nbsp;日开始&nbsp;&nbsp;&nbsp;&nbsp;丰台体育中心体育场&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">二、竞赛项目&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（一）男子足球采用国家体育总局最新出版足球竞赛规则。</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（二）比赛采用&nbsp;11&nbsp;人制，分为小组赛和决赛。</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">小组赛：小组循环；决赛：单淘汰赛。</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">三、报名办法&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（一）各单位报领队、教练各一人，每队限报运动员&nbsp;20人，运动员年龄不限。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（二）每队交纪律保证金&nbsp;10000&nbsp;元。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（三）报名时间、地点&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">2015&nbsp;年&nbsp;11&nbsp;月&nbsp;6—8&nbsp;日登陆体团足球官方APP本次赛事页面，进行登陆报名。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（四）参赛单位要保证运动员身体健康，无任何影响运动的器质性疾病如发热、高血压、心脑血管等疾病，并签订身体健康保证书。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">四、决赛竞赛办法&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（一）采用国家体育总局最新出版足球竞赛规则。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（二）比赛采用&nbsp;11&nbsp;人制，分为小组赛和决赛。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">小组赛：小组循环；决赛：单淘汰赛。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（三）每队必须提前&nbsp;30&nbsp;分钟到场，开赛后&nbsp;10&nbsp;分钟未到的队按弃权处理，判对方胜。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（四）比赛用球使用&nbsp;5&nbsp;号球。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（五）全程比赛时间为&nbsp;80&nbsp;分钟，上下半场各&nbsp;40&nbsp;分钟，中间休息&nbsp;10&nbsp;分钟。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（六）每场比赛替换人数不限，但换下场队员不能再换上。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（七）所有参赛队员至少准备深浅两套颜色不同的比赛服。比赛时一律穿足球鞋（短钉），带护腿板，各队备队长袖标。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（八）如比赛必须决出胜负，全场比赛结束时，双方仍平局，则采用直接互罚点球方式决出胜负。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（九）决定名次：&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">1、每队胜一场得&nbsp;3&nbsp;分，平一场得一分，负一场得&nbsp;0&nbsp;分，积分多名次列前。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">2、如遇两队或两队以上积分相等，则按下列顺序决定名次：&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">A.积分相等的队相互之间比赛的胜者名次列前；&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">B.积分相等相互之间比赛的净胜球多者名次列前；&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">C.积分相等的队相互之间比赛的进球数多者名次列前；&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">D.如仍相等，则采用抽签的方法决定名次。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">五、纪律规定&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（一）如在球场上发生冲突、斗殴等暴力事件，送交公安部门处理并扣除纪律保证金。</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（二）无故退赛扣除纪律保证金。</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（三）比赛中队员被裁判员出示一张黄牌，罚款&nbsp;100&nbsp;元；出示一张红牌，罚款&nbsp;200&nbsp;元。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">（四）比赛期间如发生违规事件，仲裁委员会要尽快调查，并按有关规定做出处罚。仲裁委员会未做出决定前有关违规队员不得参赛。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">六、录取与奖励&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">录取前四名，并给予奖励。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">七、领队会时间&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal" style="text-indent:28.0000pt; mso-char-indent-count:2.0000; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">2015&nbsp;年&nbsp;11月&nbsp;6&nbsp;日&nbsp;9:30&nbsp;在丰台管委会（外环西路8号）三层第四会议室召开领队会。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">八、本规程解释、修改权属组委会，未尽事宜另行通知。&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">九、联系方式&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">联系电话：13901057078&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;13701256115</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">联&nbsp;系&nbsp;人：王银涛&nbsp;&nbsp;高宏凯&nbsp;&nbsp;&nbsp;&nbsp;组委会&nbsp;&nbsp;</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal"><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">十</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">、</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">小组对阵</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal" style="line-height:150%; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">1.&nbsp;A组及B组，分别通过随机抽签确定分组情况，进行第一阶段的小组比赛；</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal" style="line-height:150%; "><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; ">2．&nbsp;A组及B组，抽签确定A1~A4及B1~B4，两小组对阵情况如下表：</span><span style="mso-spacerun:'yes'; font-family:宋体; font-size:14.0000pt; mso-font-kerning:1.0000pt; "><o:p></o:p></span></p><p class="MsoNormal" style="line-height:150%; "><span style="mso-spac